 </span>
<p>
 <span style="color: #333333;">Деревянное мансардное окно с верхним открыванием</span>
</p>
<p>
 <span style="color: #333333;">Признанный стандарт функциональности и качества – усовершенствованная версия самой популярной модели окон VELUX.<br>
	 Обновленная ручка-планка в верхней части окна обеспечивает удобство открывания и имеет встроенный вентиляционный клапан. Кроме того, при таком открывании под окном удобно расположить мебель.</span>
</p>
