 <span style="color: #333333;">Уникальное белое влагостойкое окно. Каркас из клееной древесины покрыт монолитным полиуретаном. Сохраняя все преимущества классической модели, – удобство открывания и встроенную вентиляцию – это окно не боится влаги, стойко к механическим воздействиям и не требует ухода. Рекомендуется использовать в ванных комнатах, кухнях, бассейнах или даже банях.</span>
</p>
