Комбинации мансардных окон VELUX помогут заполнить комнату светом и создать удивительное ощущение единства с окружающим миром. Мансардные окна VELUX можно комбинировать, чтобы добиться прекрасного панорамного вида и нужного уровня естественного освещения. Необычные комбинации окон придадут вашему дому индивидуальность!";s:17:"PREVIEW_TEXT_TYPE";s:4:"html";s:18:"~PREVIEW_TEXT_TYPE";s:4:"html";s:14:"DETAIL_PICTURE";N;s:15:"~DETAIL_PICTURE";N;s:11:"DETAIL_TEXT";s:5739:"<h4> <span style="color: #454545;"><span style="font-size: 15pt;">Окно-балкон VELUX CABRIO</span> </span> </h4>
 <img width="429" alt="Окно-балкон VELUX CABRIO.png" src="/upload/medialibrary/0e0/0e0f89da8ff2c80c50916acefcafc375.png" height="230" title="Окно-балкон VELUX CABRIO.png"><span style="color: #454545;"><br>
 </span>
<p>
 <span style="color: #454545;">Такое окно-трансформер является отличным решением для тех, кто ценит практичность. Чтобы превратить окно в балкон, Вам нужно всего лишь поднять верхнюю секцию, выдвинуть вперед нижнюю секцию, и вот Вы уже дышите свежим воздухом на своем балконе.</span>
</p>
<p>
 <span style="color: #202020;"><b>Характеристики:&nbsp;</b></span><span style="color: #202020;">Система VELUX CABRIO®&nbsp;<br>
	 Двухкамерный стеклопакет&nbsp;<br>
	 Встроенная вентиляция&nbsp;<br>
	 Вентиляционный клапан со съемным моющимся фильтром&nbsp;<br>
	 Система изоляции и защиты от ветра и холодного воздуха - ThermoTechnology™&nbsp;<br>
	 Панорамный вид&nbsp;<br>
	 Пропускает больше естественного света</span>
</p>
<hr>
<h4> <span style="color: #454545; font-size: 15pt; font-weight: 600;">Терраса VELUX GEL</span> </h4>
<p>
 <span style="color: #454545; font-size: 24px; font-weight: 600;"><img width="429" alt="Терраса VELUX GEL.jpg" src="/upload/medialibrary/d90/d905765bf17c6f38c8359616d495fe88.jpg" height="230" title="Терраса VELUX GEL.jpg"><br>
 </span>
</p>
<p>
 <span style="color: #454545;">Терраса Велюкс встраивается в нижнюю часть крыши, а открыв верхнюю и нижнюю секции мансардного окна Вы получаете возможность свободного выхода на свежий воздух. Вправо или влево будет открываться нижняя секцияя Вы выбираете на этапе установки.</span>
</p>
<p>
 <span style="color: #202020;"><b>Характеристики:&nbsp;</b></span><span style="color: #202020;">2 в 1 - мансардное окно и терраса&nbsp;<br>
	 Встроенная вентиляция&nbsp;<br>
	 Вентиляционный клапан со съемным моющимся фильтром&nbsp;<br>
	 Система изоляции и защиты от ветра и холодного воздуха - ThermoTechnology™&nbsp;<br>
	 Панорамный вид&nbsp;<br>
	 Пропускает больше естественного света</span>
</p>
<hr>
<h4> <span style="color: #454545; font-size: 15pt; font-weight: 600;">Наклонные элементы GIL 3073, GIU 0073&nbsp;</span> </h4>
<p>
 <span style="color: #454545; font-size: 24px; font-weight: 600;"><img width="429" alt="Наклонные элементы GIL 3073, GIU 0073.jpg" src="/upload/medialibrary/6b3/6b3788874946271fff9c3f0cc81cdef5.jpg" height="230" title="Наклонные элементы GIL 3073, GIU 0073.jpg"><br>
 </span>
</p>
<p>
 <span style="color: #454545;">Глухой нижный наклонный элемент, который не открывается.</span>
</p>
<p>
 <span style="color: #202020;"><b>Характеристики:&nbsp;</b></span><span style="color: #202020;"><b>Материал:</b> дерево (сосна)/белый влагостойкий полиуретан&nbsp;<br>
	 Стеклопает с «триплексом»&nbsp;<br>
	 Внешнее закаленное стекло</span>
</p>
<hr>
<h4> <span style="color: #454545;"><span style="font-size: 15pt;">Карнизные окна VFE, VIU</span>&nbsp; </span> </h4>
