Фирменные шторы, жалюзи и рольставни VELUX приспособлены к работе в наклонной плоскости кровли. Они не провисают, идеально подходят под размер окна и легко устанавливаются.";s:17:"PREVIEW_TEXT_TYPE";s:4:"html";s:18:"~PREVIEW_TEXT_TYPE";s:4:"html";s:14:"DETAIL_PICTURE";s:4:"1280";s:15:"~DETAIL_PICTURE";s:4:"1280";s:11:"DETAIL_TEXT";s:7926:"<h3> <span style="font-size: 15pt;">Затемняющая штора "Сиеста"</span> </h3>
 <img width="364" alt="Затемняющая штора Сиеста.jpg" src="/upload/medialibrary/449/449afa5e8d73ec9d0c11e1475df26a77.jpg" height="280" title="Затемняющая штора Сиеста.jpg"><br>
<p>
	 Затемняющие шторы обеспечивют полное затемнение помещения в любое время суток.
</p>
<p>
	 Это отличное решение для спален, детских комнат, а также для домашних кинотеатров, где требуется полная блокировка дневного света. Штора изготовлена из устойчивого к загрязнению полиэстера со специальным алюминиевым теплоотражающим покрытием с тыльной стороны, которое отражает излишний жар летом и сохраняет тепло внутри помещения зимой.
</p>
<h3> <span style="font-size: 15pt;">Затемняющая штора "Дуо"</span> </h3>
<p>
 <img src="https://srv4.imgonline.com.ua/result_img/imgonline-com-ua-Resize-npD15EscegGk.jpg"><br>
</p>
<p>
	 Затемнение и плиссе в одной шторе. К нижней части затемняющей шторы "Сиеста" крепится штора-плиссе белого цвета. Создайте необходимую степень затемнения с помощью этой комбинации. Ручное управление и 24 варианта расцветки в сочетании с белой шторой-плиссе.
</p>
<h3> <span style="font-size: 15pt;">Рулонная штора</span> </h3>
 <img width="374" src="/upload/medialibrary/b45/b45891dfe77dd99c7249afe09a7d2af7.png" height="288"><br>
<p>
	 Рулонные шторы VELUX обеспечивают защиту от посторонних глаз, в то же время оставляя доступ естественному свету извне. Мягко приглушая дневногй свет, они придают ему оттенок в зависимости от цвета шторы. Таким образом, рулонные шторы прекрасно подходят для гостиных, кабинетов, игровых комнат и любых других зон, где необходимо создать атмосферу приватности и нет потребности в полной светоизоляции.
</p>
<h3> <span style="font-size: 15pt;">Штора-плиссе</span> </h3>
 <img width="364" alt="Штора-плиссе.jpg" src="/upload/medialibrary/352/35244d8d5ff4ef4d9c5f895b26fe4508.jpg" height="280" title="Штора-плиссе.jpg"><br>
<p>
	 Штора-плиссе приглушает яркий дневной свет и позволяет привносит индивидуальность в интерьер вашей комнаты. Она фиксируется в любой части окна или может быть закрыта полностью. Идеальна для гостиной, а также любого помещения, где требуется смягчить освещенность.
</p>
<h3><span style="font-size: 15pt;">Жалюзи</span></h3>
 <img width="364" alt="Жалюзи.jpg" src="/upload/medialibrary/9ad/9adace08a07229a42fbc864d64020efa.jpg" height="280" title="Жалюзи.jpg"><br>
<p>
	 Жалюзи обеспечивают вам полный контоль над освещением. Это оптимальное решение для помещений, где вы хотите отрегулировать количество и направление дневного света. Жалюзи изготовлены из алюминия с водостойким покрытием. Прекрасно подходят для влажных помещений и офисов.Управляются ручкой-планкой без использования традиционного шнура.
</p>
<p>
	 Для защиты от перегрева помещения в летнее время мы советуем также установить маркизет.
</p>
<h3> <span style="font-size: 15pt;">Маркизет</span> </h3>
 <img width="364" src="https://srv3.imgonline.com.ua/result_img/imgonline-com-ua-Resize-FiPMoVNdJMfq0.jpg" height="270"><br>
<p>
	 Для лучшей защиты от жары поток солнечного света следует остановить прежде, чем он достигнет оконного стекла. Вот почему маркизет устанавливается на окно снаружи. Все управление производится изнутри помещения. Маркизет полностью убирается внутрь оклада на время, когда он не нужен. Материал, из которого изготовлен маркизет полупрозрачен, поэтому ничто не препятствует виду из окна. Этот аксессуар сохраняет прохладу и существенно (до 90%) снижает нагрев помещения под крышей в жаркие летние дни.
</p>
<h3> <span style="font-size: 15pt;">Рольставни</span> </h3>
<p>
 <img width="364" alt="Рольставни.jpg" src="/upload/medialibrary/975/975fc4ad3142daf4a4b9e01b3b829606.jpg" height="280" title="Рольставни.jpg"><br>
</p>
<p>
	 Стремитесь защититься и от света, и от жары палящего солнца? Рольставни VELUX - лучшее решение проблемы. Они уменьшают шум во время дождя и града, летом защищают от жары, а зимой - от холода. Рольставни также снижают вероятность взлома. Их надежная конструкция прекрасно гармонирует с любым видом кровельного покрытия. Мансардные окна VELUX можно открывать и при закрытых рольставнях. В полностью закрытом положении рольставни обеспечивают стопроцентное затемнение помещения.
</p>
<p>
	 Рольставни сочетаются как с мансардным окном VELUX, так и со всеми видами кровельных покрытий.
</p>
<p>
 <span style="font-size: 15pt; font-weight: 600;">Москитная сетка</span><br>
</p>
<p>
 <span style="font-size: 24px; font-weight: 600;"><img width="364" alt="Москитная сетка.jpg" src="/upload/medialibrary/312/3124f4f66f65437be1cde296c372013d.jpg" height="280" title="Москитная сетка.jpg"><br>
 </span>
</p>
<p>
	 Главное назначение москитной сетки VELUX - не позволить нежелательным гостям, таким как мухи, комары и другие насекомые, проникнуть в помещение через открытое мансардное окно. Москитная сетка прозрачна и не задерживает свежий воздух и свет. В нерабочем состоянии сетку убирают в корпус над окном, так что она не препятствует обзору.
</p>
