</p>
<p>
	 Стремитесь защититься и от света, и от жары палящего солнца? Рольставни VELUX - лучшее решение проблемы. Они уменьшают шум во время дождя и града, летом защищают от жары, а зимой - от холода. Рольставни также снижают вероятность взлома. Их надежная конструкция прекрасно гармонирует с любым видом кровельного покрытия. Мансардные окна VELUX можно открывать и при закрытых рольставнях. В полностью закрытом положении рольставни обеспечивают стопроцентное затемнение помещения.
</p>
<p>
	 Рольставни сочетаются как с мансардным окном VELUX, так и со всеми видами кровельных покрытий.
</p>
<p>
 <span style="font-size: 15pt; font-weight: 600;">Москитная сетка</span><br>
</p>
<p>
 <span style="font-size: 24px; font-weight: 600;"><img width="364" alt="Москитная сетка.jpg" src="/upload/medialibrary/312/3124f4f66f65437be1cde296c372013d.jpg" height="280" title="Москитная сетка.jpg"><br>
 </span>
</p>
<p>
	 Главное назначение москитной сетки VELUX - не позволить нежелательным гостям, таким как мухи, комары и другие насекомые, проникнуть в помещение через открытое мансардное окно. Москитная сетка прозрачна и не задерживает свежий воздух и свет. В нерабочем состоянии сетку убирают в корпус над окном, так что она не препятствует обзору.
</p>
