<h5>Шифер 7-ми волновой 5,5 мм, лист</h5>
 <b>Технические характеристики:</b>
<p>
</p>
<div>
	 Длина,&nbsp;1750 мм <br>
	 Ширина,&nbsp;980 мм <br>
	 Толщина&nbsp;5,5 мм &nbsp; &nbsp; &nbsp; <br>
	 Высота рядовой волны&nbsp;40 мм&nbsp; <br>
	 Шаг волны,&nbsp;150 мм &nbsp;&nbsp;&nbsp;&nbsp; <br>
	 Плотность&nbsp;1,6 г/куб.см<br>
	 Водонепроницаемость, не менее -&nbsp;24 <br>
	 Морозостойкость &nbsp;&nbsp;25 лет
</div>
<p>
</p>
 <b>Применение:</b>
<div>
</div>
<div>
	 * Для устройства кровель и стеновых ограждений в строительстве жилых и производственных зданий; <br>
	 * Для сооружения складов, навесов, устройства вентилируемых фасадов&nbsp;
</div>
<p>
</p>
<p>
</p>
<div>
 <b>Обратите внимание!</b><b> </b> <br>
	 Для расчета необходимого количества листов 7-ми волнового шифера, нужно разделить площадь крыши на 1,5
</div>
<p>
</p>
