Основу термопанелей составляет пенополиуретан. Этот материал, в отличие от более традиционных утеплителей (пенополистерол, стекловата, минеральная вата) обладает очень низкой теплопроводностью, что приводит к минимальным теплопатерям. При использовании пенополиуретановых панелей с отделкой из клинкерной плитки для теплоизоляции дома, хозяева получают долговечное, экологичное утепление жилища и оригинальный дизайн фасада.";s:13:"~PREVIEW_TEXT";s:864:"<div>
 <b>Фасадные термопанели TERMOSIT</b>
</div>
Основу термопанелей составляет пенополиуретан. Этот материал, в отличие от более традиционных утеплителей (пенополистерол, стекловата, минеральная вата) обладает очень низкой теплопроводностью, что приводит к минимальным теплопатерям. При использовании пенополиуретановых панелей с отделкой из клинкерной плитки для теплоизоляции дома, хозяева получают долговечное, экологичное утепление жилища и оригинальный дизайн фасада.";s:17:"PREVIEW_TEXT_TYPE";s:4:"html";s:18:"~PREVIEW_TEXT_TYPE";s:4:"html";s:14:"DETAIL_PICTURE";N;s:15:"~DETAIL_PICTURE";N;s:11:"DETAIL_TEXT";s:2789:"<p>
	 Теплоизоляционная панель <b>TERMOSIT&nbsp;</b>состоит из плиты изготовленной из жесткого пенополиуретана и вживленных в нее по специальной технологии, клинкерных плиток. Расчет толщины теплоизоляционного слоя проводится для конкретной климатической зоны применения системы.<br>
</p>
<h5><b>Термопанели&nbsp;- имеют множество плюсов в пользу выбора для облицовки дома:</b></h5>
<ul type="disc">
	<li>жаро- и морозоустойчивость - это значит, что монтаж может производиться практически в любое время года;</li>
	<li>доступный монтаж, который, при желании, можно освоить самостоятельно;</li>
	<li>привлекательный внешний вид. Как было сказано выше, помимо непосредственно теплоизоляции дома, панели помогают создать уникальный дизайн фасада;</li>
	<li>дополнительная защита фасада от влаги;</li>
	<li>длительный срок службы.</li>
</ul>
<p>
	 И это лишь часть аргументов «за» использование термопанелей <b>TERMOSIT</b>. Термопанели <b>TERMOSIT</b>&nbsp;сочетают в себе всё самое лучшее: эффективный утеплитель - пенополиуретан, и декоративно-защитный слой из высококачественной фасадной плитки, которая придает дому неповторимый и только ему присущий вид. Что касается монтажа теплоизоляционных панелей, то он не требует каких-либо узкоспециальных знаний или умений. Термопанели крепятся к основанию&nbsp;дюбелями. Швы, остающиеся между панелями, затираются специальными затирочными составами, и фасад становится трудноотличим от настоящей кирпичной кладки.
</p>
