Каждый хочет, чтобы его
дом был самым теплым, самым уютным и самым красивым. Достичь этого помогает
удачно подобранная внешняя отделка. Именно она сделает ваш дом уникальным,
выделив его из однотипной массовой застройки и придав индивидуальность. Успешно
с такой задачей справляется профиль дня фасадов. Кроме исключительно
декоративной функции он еще и позволяет уложить дополнительный слой
теплоизоляционных материалов, что дает возможность сохранять тепло и защищать
здание от влаги и других неблагоприятных воздействий окружающей среды.";s:13:"~PREVIEW_TEXT";s:1057:"<b>Фасадный профиль&nbsp;</b><br>
Каждый хочет, чтобы его
дом был самым теплым, самым уютным и самым красивым. Достичь этого помогает
удачно подобранная внешняя отделка. Именно она сделает ваш дом уникальным,
выделив его из однотипной массовой застройки и придав индивидуальность. Успешно
с такой задачей справляется профиль дня фасадов. Кроме исключительно
декоративной функции он еще и позволяет уложить дополнительный слой
теплоизоляционных материалов, что дает возможность сохранять тепло и защищать
здание от влаги и других неблагоприятных воздействий окружающей среды.";s:17:"PREVIEW_TEXT_TYPE";s:4:"html";s:18:"~PREVIEW_TEXT_TYPE";s:4:"html";s:14:"DETAIL_PICTURE";N;s:15:"~DETAIL_PICTURE";N;s:11:"DETAIL_TEXT";s:3766:"<p>
	 Профили для вентилируемых фасадов могут быть изготовлены из стали или алюминия. Преимущество алюминия в небольшом весе. Благодаря этому профили могут монтироваться на большие площади стен, не создавая дополнительной нагрузки на фундамент. Но, если вы решили использовать тяжелые отделочные материалы лучше отдать предпочтение профилю из оцинкованной стали.
</p>
<p>
	 По своей конфигурации профили могут быть Z,П,Г и Т-образные. Последний вариант наиболее универсальный. На него можно крепить любые панели. При этом гарантировано достигается наличие свободного воздушного пространства между стеной и облицовочным слоем.
</p>
<p>
</p>
