 <b>Карнизная система пластиковая</b>&nbsp;изготавливается из высококачественного поливинилхлорида (ПВХ) устойчивого к ультрафиолетовому излучению. Пластиковые панели и комплектующие для подшивки карнизов имеют достаточную прочность для выполнения своих функций на протяжении всего срока эксплуатации карнизной системы.<br>
</p>";s:13:"~PREVIEW_TEXT";s:604:"<p>
 <b>Карнизная система пластиковая</b>&nbsp;изготавливается из высококачественного поливинилхлорида (ПВХ) устойчивого к ультрафиолетовому излучению. Пластиковые панели и комплектующие для подшивки карнизов имеют достаточную прочность для выполнения своих функций на протяжении всего срока эксплуатации карнизной системы.<br>
</p>";s:17:"PREVIEW_TEXT_TYPE";s:4:"html";s:18:"~PREVIEW_TEXT_TYPE";s:4:"html";s:14:"DETAIL_PICTURE";N;s:15:"~DETAIL_PICTURE";N;s:11:"DETAIL_TEXT";s:4341:"<p>
	 Пластиковые карнизные системы могут быть произведены различной цветовой гаммой, самым распространенным цветом стал белый и коричневый (кофе). Необходимо знать, что пластиковые карнизные панели производятся сплошного сечения, с перфорацией и комбинированные в которых одна из трех полос имеет перфорированную структуру. Перфорация пластиковой панели означает что её плоскость изрешечена мелкими отверстиями для прохождения через неё воздуха. Перфорированные панели карнизной обшивки необходимы так как они обеспечивают правильную вентиляцию кровли путем прохождения воздуха через карнизное пространство с последующим движением воздуха в коньковую зону. К преимуществам таких пластиковых карнизных систем относят очень хорошую устойчивость против выцветания и агрессивных сред окружающей среды. К недостатку пластиковой карнизной системы относится его температурное расширение, что в свою очередь может сказаться только при неправильной технологии монтажа, при которой не выверяются требуемые зазоры в местах крепления пластиковых карнизных панелей.<br>
