</p>";s:13:"~PREVIEW_TEXT";s:572:"<p>
 <b>Плиты OSB</b> - Это современный строительный и отделочный материал, состоящий на 90% из щепок древесины, связанных синтетическими водостойкими смолами. Плиты образованы 3-4 слоями тонкой стружки длиной до 15 см, спрессованной при высоком давлении и температуре, причем направление стружки в каждом слое – свое.
</p>";s:17:"PREVIEW_TEXT_TYPE";s:4:"html";s:18:"~PREVIEW_TEXT_TYPE";s:4:"html";s:14:"DETAIL_PICTURE";N;s:15:"~DETAIL_PICTURE";N;s:11:"DETAIL_TEXT";s:2881:"<h5>
Плиты OSB может применяться при: </h5>
<p>
</p>
<div>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; производстве сэндвич-панелей и строительстве каркасных домов, <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; при устройстве перекрытий, лестниц,<br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; обшивке стен, потолков, полов, <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; для покрытия крыш, <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; при вспомогательных работах (монтаж опалубки, лесов), <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; для изготовления вспомогательных построек (сараев, хранилищ), уличных конструкций, заборов, <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; в качестве конструктивных элементов мебели.
</div>
<p>
</p>
<p>
	 Качественные OSB соответствуют стандарту <b>EN 300 OSB</b>, предъявляющему требования к экологической безопасности и техническим параметрам плит.
</p>
<p>
 <b>Производители иногда называют OSB</b> – «усовершенствованной» древесиной. Она такая же прочная, легкая и простая в обработке, &nbsp;но в то же время лишена таких недостатков, как пожароопасность, подверженность гниению и плесени, наличие пустот и сучков. По техническим свойствам OSB превосходят <b>ДСП</b>, <b>ДВП</b>, <b>МДФ</b> и даже фанеру.
</p>
<p>
	 Заводское конвейерное производство позволяет обеспечить стабильные размеры и равномерную толщину по всей плите. OSB обеспечивает отличную звукоизоляцию, сохранение тепла, она не подвержена деформации и разрушению в воде. Для ее обработки применяются те же инструменты и материалы, что и для древесины. Большие размеры листов позволяют возводить стены с минимальным количеством стыков. Срок службы конструкций из таких плит практически неограничен.
</p>
<p>
	 &nbsp;
