	 Высокая паропроницаемость материалов <b>Tyvek</b> позволяет влаге из утеплителя и других элементов конструкции свободно проходить в вентилируемое пространство, что предотвращает скапливание конденсата, разрушения древесины, препятствует снижению характеристик теплоизоляции.
</p>
<p>
 <b> </b>
</p>
<p>
	 В конструкциях стен каркасного типа важное значение имеет защита утеплителя с помощью&nbsp;<b>Tyvek</b>&nbsp;от воздействия ветрового напора и воздухопроницаемости через щели и стыки элементов. Монтаж мембраны&nbsp;Tyvek&nbsp;может осуществляться непосредственно на теплоизоляцию и стропильную конструкцию без вентиляционного зазора.
</p>
<p>
 <b>Tyvek</b><sup><b>®</b></sup><b>&nbsp;</b>устойчивы к воздействию ультрафиолета и высоких температур. Их уникальная однослойная конструкция позволяет отводить пар, удерживая влагу. Это обеспечивает защиту от конденсата, влаги и попадания воздуха на внешние стены. Воздухо- и пароизоляционные мембраны
</p>
