<h5>ТЕХНОЛАЙТ</h5>
 <img src="http://www.tn.ru/img_out/catalogue_classes_products/uploadxs1xzs64vs8.jpg"><br>
 <b>Область применения:<br>
 </b>Плиты ТЕХНОЛАЙТ предназначены для тепло-, звукоизоляции строительных конструкций жилых зданий и промышленных сооружений, в которых утеплитель не воспринимает внешнюю нагрузку (мансарды, чердачные перекрытия, полы с укладкой утеплителя между лагами; каркасные перегородки), а также в качестве первого (внутреннего) теплоизоляционного слоя в фасадных системах с воздушным зазором при двухслойном исполнении теплоизоляции.<br>
 <br>
<h5>РОКЛАЙТ</h5>
 <img src="http://www.tn.ru/img_out/catalogue_classes_products/uploadiscdvoqbihy.jpg"><br>
 <b>Область применения:<br>
 </b>Материал РОКЛАЙТ рекомендованы для применения в коттеджном и малоэтажном строительстве в качестве тепло- звукоизоляции горизонтальных, наклонных и вертикальных конструкциях, таких как мансарды, каркасные стены, стены с отделкой сайдингом, полы и перекрытия, перегородки.<br>
 <br>
<h5>ТЕХНОБЛОК</h5>
 <img src="http://www.tn.ru/img_out/catalogue_classes_products/uploadbliaobq6t6v.jpg"><br>
 <b>Область применения:&nbsp;</b><br>
 Плиты ТЕХНОБЛОК рекомендованы для применения в качестве тепло-, звукоизоляции различных типов слоистых кладок, каркасных стен (в том числе наружных) с различными видами отделки (в том числе сайдингом). А также в качестве первого (внутреннего) теплоизоляционного слоя в навесных фасадных системах с воздушным зазором при двухслойной схеме утепления.&nbsp;
<h5><br>
 </h5>
