<p>
</p>
<p>
</p>
<div>
	Металлокассеты с открытым (наружным, видимым) креплением крепятся с помощью винтов, которые не скрываются элементами конструкции и видны человеческому глазу. Как правило, при таком способе крепления крепежные винты окрашивают в цвет металлокассет, что делает их незаметными в общей плоскости фасада. <br>
 <br>
	Фасадные кассеты изготавливаются под конкретный размер. Исходя из различных условий работы, кассеты имеют рекомендуемые размеры, материалы, определяемые также пригодностью к обработке, мощностью оборудования. Собственное производство позволяет удовлетворить индивидуальные запросы заказчика, как по габаритам кассет, так и по цвету, обеспечить его качественным изделием в короткие сроки и по выгодным ценам.<br>
	 Фасадные металлокассеты&nbsp; изготавливаются из оцинкованной стали с полимерно-порошковым покрытием.<br>
	 Широчайший диапазон цветов полимерного покрытия металлических фасадных кассет позволяет полностью изменить архитектурный вид фасада и придать зданию яркий современный и неповторимый облик.
</div>
<p>
</p>
 <b>Преимущества:</b>
<div>
	- Пожаробезопасность.&nbsp;Металлокассеты изготавливаются из оцинкованной стали которая не горит, и не содержит полимерных наполнителей как аналоги которые еще и токсичны <br>
	 -&nbsp;Экономия денег при&nbsp;монтаже фасада.&nbsp;Монтаж металлокассет обходится дешевле так как не требуется фрезеровка материалла, как на аллюминиевых композитных панелях <br>
	- Скорость&nbsp;установки металлокассет. В&nbsp;виду простоты конструкции получается добиться высокой скорости монтажа, не жертвуя качеством фасадной конструкции <br>
	- Низкий вес облицовочного материала.&nbsp;Металлокассета в 2 раза легче тяжелого керамогранита, это позволяет снизить нагрузку на фасадные стены здания <br>
	 - Широкая палитра цветов, полимерно порошковая(полиэфирная) покраска.&nbsp;Металлокассеты окрашиваются в любые цвета доступные каталогу RAL и не только, например допустимы получения фактурных оттенков <br>
	 - Отсутствие дополнительных расходов и утилизации излишних обрезей.&nbsp;Металлокассета это готовый продукт и не нуждается в доработке перед монтажем, вся обрезь образующаяся&nbsp;в ходе изготовления ложиться на производителя.
</div>
