 <b>Деревянные чердачные лестницы FAKRO</b> – надежные, прочные и безопасные конструкции. Они станут незаменимым помощником и прослужат вам долгие годы.<br>";s:17:"PREVIEW_TEXT_TYPE";s:4:"html";s:18:"~PREVIEW_TEXT_TYPE";s:4:"html";s:14:"DETAIL_PICTURE";N;s:15:"~DETAIL_PICTURE";N;s:11:"DETAIL_TEXT";s:3843:"Мансарды загородных домов и дач часто выполняют функцию кладовых. Чтобы доступ в это помещение был максимально удобным и безопасным, понадобится надежная и крепкая конструкция. Складные или раздвижные деревянные чердачные лестницы FAKRO обладают всеми необходимыми характеристиками: они надежны, безопасны, просты в использовании и очень компактны.<br>
 &nbsp;
<h5>Преимущества складных и раздвижных конструкций для дома компании FAKRO</h5>
 • Складная чердачная лестница позволяет сэкономить свободное пространство в доме. Она легко складывается и убирается для хранения в потолок, не занимает много места.<br>
 • Утепленная крышка люка предотвратит проникновение холодного воздуха в жилое помещение. Особенно это важно в наших суровых климатических условиях.<br>
 • Специальные противоскользящие выемки на ступенях и боковой поручень обеспечивают безопасный подъем.<br>
 • Простой и удобный монтаж без подъема на чердак. Самостоятельно установить конструкцию и подогнать ее по высоте не составит труда.<br>
 • Выдерживает нагрузку до 160 кг.<br>
 • Гарантия 3 года.<br>
