	В настоящее время сотни миллионов квадратных метров кровельных мембран на основе EPDM и ТПО успешно применяются во всем мире. Используют кровельные системы:<br>
</div>
<h5><br>
</h5>
<h5>Балластная система</h5>
<p>
 <img width="240" alt="бал.jpg" src="/upload/medialibrary/e57/e57e895332b72d71f5f580087adcca64.jpg" height="132" title="бал.jpg"><br>
</p>
<p>
	 В балластной системе Firestone, полотна EPDM укладываются без закрепления на соответствующее основание. Соседние полотна соединяются с нахлестом не менее 100 мм и соединяются с помощью самоклеящейся ленты Firestone QuickSeam® Tape. Гидроизоляция примыканий кровли по периметру и узлов сопряжений элементов покрытия осуществляется согласно техническим условиям компании Firestone. После завершения укладки EPDM-мембрана фиксируется при помощи насыпаемого на нее гравия или мелкого щебня с минимальным весом 50 кг/м 2.
</p>
<p>
</p>
<div>
 <b>Особенности системы:&nbsp;</b><br>
	 - Низкая стоимость монтажа<br>
	 - Использование больших полотен EPDM<br>
	 - Малое количество швов<br>
	 - Высокая скорость работ &nbsp; &nbsp;<br>
 <span style="font-size: 16px; font-weight: 600;"><br>
 </span><span style="font-size: 16px; font-weight: 600;">Инверсионная система<br>
 </span><br>
 <img width="240" alt="12.jpg" src="/upload/medialibrary/e54/e544f3a540aaf70b1ec36d853eda2efa.jpg" height="132" title="12.jpg"><br>
 <br>
	 Инверсионная система Firestone является разновидностью традиционной балластной системы и идеальна для кровель с эксплуатируемых и/или районов с суровым климатом. Большие полотна EPDM отделяются от балласта слоем водостойких теплоизоляционных плит и геотекстиля, который укладывается поверх мембраны.<br>
</div>
 <br>
 Балластная или инверсионная система может применяться для любых зданий, способных выдерживать дополнительную нагрузку, создаваемую балластом, и имеющих уклон крыши не более 1:6.
<p>
 <b>Особенности системы: </b><br>
	 - Низкая стоимость монтажа<br>
	 - Использование больших полотен EPDM<br>
	 - Малое количество швов<br>
	 - Высокая скорость работ
</p>
<h5>Полностью приклеенная система (FAS)</h5>
 <br>
 <img width="240" alt="123.jpg" src="/upload/medialibrary/044/0442c98491751bea596a19f337cb674d.jpg" height="132" title="123.jpg"><br>
 В полностью приклеенной системе Firestone полотна EPDM полностью приклеиваются непосредственно к соответствующему основанию с использованием монтажного клея Bonding Adhesive Firestone. Соседние полотна укладываются с нахлестом не менее 100 мм и соединяются с помощью самоклеящейся ленты Firestone QuickSeam®Tape, создавая сплошной водонепроницаемого ковра.
<p>
	 Гидроизоляция примыканий кровли по периметру и узлов сопряжений элементов покрытия осуществляется согласно техническим условиям компании Firestone.<br>
	 Полностью приклеенная система может использоваться на любых зданиях, несущая конструкция крыши которых совместима с системой крепления теплоизоляции и обеспечивает требуемое сопротивление выдергиванию. Используемая теплоизоляция должна быть совместима с монтажным клеем Bonding Adhesive Firestone.
</p>
<p>
 <b>Особенности системы: </b><br>
	 - Применение на крышах с любым уклоном<br>
	 - Применение для крыш со сложной конфигурации<br>
	 - Небольшой вес кровли<br>
	 - Высокая устойчивость к ветровым нагрузкам
</p>
<h5> <b>Клеи, герметики, очиститель и окрасочный состав:</b> </h5>
<p>
</p>
<div>
 <img width="240" alt="клеи.jpg" src="/upload/medialibrary/c25/c25691895be2f2da24c695b0e3ee680a.jpg" height="158" title="клеи.jpg"><br>
	 - Монтажный клей;<br>
	 - Монтажный клей на водной основе;<br>
	 - Клей для швов;<br>
	 - Краевой герметик;<br>
	 - Водоотталкивающая мастика;<br>
	 - Жидкий герметик;<br>
	 - Очиститель.
</div>
 <br>
 <br>
<p>
</p>";s:12:"~DETAIL_TEXT";s:5891:"<div>
	В настоящее время сотни миллионов квадратных метров кровельных мембран на основе EPDM и ТПО успешно применяются во всем мире. Используют кровельные системы:<br>
</div>
<h5><br>
</h5>
<h5>Балластная система</h5>
<p>
 <img width="240" alt="бал.jpg" src="/upload/medialibrary/e57/e57e895332b72d71f5f580087adcca64.jpg" height="132" title="бал.jpg"><br>
</p>
<p>
	 В балластной системе Firestone, полотна EPDM укладываются без закрепления на соответствующее основание. Соседние полотна соединяются с нахлестом не менее 100 мм и соединяются с помощью самоклеящейся ленты Firestone QuickSeam® Tape. Гидроизоляция примыканий кровли по периметру и узлов сопряжений элементов покрытия осуществляется согласно техническим условиям компании Firestone. После завершения укладки EPDM-мембрана фиксируется при помощи насыпаемого на нее гравия или мелкого щебня с минимальным весом 50 кг/м 2.
</p>
<p>
</p>
<div>
 <b>Особенности системы:&nbsp;</b><br>
	 - Низкая стоимость монтажа<br>
	 - Использование больших полотен EPDM<br>
	 - Малое количество швов<br>
	 - Высокая скорость работ &nbsp; &nbsp;<br>
 <span style="font-size: 16px; font-weight: 600;"><br>
 </span><span style="font-size: 16px; font-weight: 600;">Инверсионная система<br>
 </span><br>
 <img width="240" alt="12.jpg" src="/upload/medialibrary/e54/e544f3a540aaf70b1ec36d853eda2efa.jpg" height="132" title="12.jpg"><br>
 <br>
	 Инверсионная система Firestone является разновидностью традиционной балластной системы и идеальна для кровель с эксплуатируемых и/или районов с суровым климатом. Большие полотна EPDM отделяются от балласта слоем водостойких теплоизоляционных плит и геотекстиля, который укладывается поверх мембраны.<br>
</div>
 <br>
 Балластная или инверсионная система может применяться для любых зданий, способных выдерживать дополнительную нагрузку, создаваемую балластом, и имеющих уклон крыши не более 1:6.
<p>
 <b>Особенности системы: </b><br>
	 - Низкая стоимость монтажа<br>
	 - Использование больших полотен EPDM<br>
	 - Малое количество швов<br>
	 - Высокая скорость работ
</p>
<h5>Полностью приклеенная система (FAS)</h5>
 <br>
 <img width="240" alt="123.jpg" src="/upload/medialibrary/044/0442c98491751bea596a19f337cb674d.jpg" height="132" title="123.jpg"><br>
 В полностью приклеенной системе Firestone полотна EPDM полностью приклеиваются непосредственно к соответствующему основанию с использованием монтажного клея Bonding Adhesive Firestone. Соседние полотна укладываются с нахлестом не менее 100 мм и соединяются с помощью самоклеящейся ленты Firestone QuickSeam®Tape, создавая сплошной водонепроницаемого ковра.
<p>
	 Гидроизоляция примыканий кровли по периметру и узлов сопряжений элементов покрытия осуществляется согласно техническим условиям компании Firestone.<br>
	 Полностью приклеенная система может использоваться на любых зданиях, несущая конструкция крыши которых совместима с системой крепления теплоизоляции и обеспечивает требуемое сопротивление выдергиванию. Используемая теплоизоляция должна быть совместима с монтажным клеем Bonding Adhesive Firestone.
</p>
<p>
 <b>Особенности системы: </b><br>
	 - Применение на крышах с любым уклоном<br>
	 - Применение для крыш со сложной конфигурации<br>
	 - Небольшой вес кровли<br>
	 - Высокая устойчивость к ветровым нагрузкам
</p>
<h5> <b>Клеи, герметики, очиститель и окрасочный состав:</b> </h5>
<p>
</p>
