:"183";s:3:"~ID";s:3:"183";s:11:"TIMESTAMP_X";s:19:"15.02.2018 10:08:50";s:12:"~TIMESTAMP_X";s:19:"15.02.2018 10:08:50";s:16:"TIMESTAMP_X_UNIX";s:10:"1518678530";s:17:"~TIMESTAMP_X_UNIX";s:10:"1518678530";s:11:"MODIFIED_BY";s:1:"2";s:12:"~MODIFIED_BY";s:1:"2";s:11:"DATE_CREATE";s:19:"21.07.2017 04:49:04";s:12:"~DATE_CREATE";s:19:"21.07.2017 04:49:04";s:16:"DATE_CREATE_UNIX";s:10:"1500601744";s:17:"~DATE_CREATE_UNIX";s:10:"1500601744";s:10:"CREATED_BY";s:1:"2";s:11:"~CREATED_BY";s:1:"2";s:9:"IBLOCK_ID";s:2:"10";s:10:"~IBLOCK_ID";s:2:"10";s:17:"IBLOCK_SECTION_ID";s:2:"75";s:6:"ACTIVE";s:1:"Y";s:7:"~ACTIVE";s:1:"Y";s:11:"ACTIVE_FROM";N;s:12:"~ACTIVE_FROM";N;s:9:"ACTIVE_TO";N;s:10:"~ACTIVE_TO";N;s:16:"DATE_ACTIVE_FROM";N;s:17:"~DATE_ACTIVE_FROM";N;s:14:"DATE_ACTIVE_TO";N;s:15:"~DATE_ACTIVE_TO";N;s:4:"NAME";s:13:"TPO Firestone";s:5:"~NAME";s:13:"TPO Firestone";s:15:"PREVIEW_PICTURE";s:4:"1930";s:16:"~PREVIEW_PICTURE";s:4:"1930";s:12:"PREVIEW_TEXT";s:497:"<b>TPO Firestone&nbsp;</b> -&nbsp; удачное сочетание кровли, безвредной для окружающей среды, великолепно сочетающей внешнюю эстетичность с&nbsp; высокой устойчивостью к ультрафиолетовому излучению, стойкость к негативным атмосферным факторам с исключительно высокой прочностью шва.<br>";s:13:"~PREVIEW_TEXT";s:497:"<b>TPO Firestone&nbsp;</b> -&nbsp; удачное сочетание кровли, безвредной для окружающей среды, великолепно сочетающей внешнюю эстетичность с&nbsp; высокой устойчивостью к ультрафиолетовому излучению, стойкость к негативным атмосферным факторам с исключительно высокой прочностью шва.<br>";s:17:"PREVIEW_TEXT_TYPE";s:4:"html";s:18:"~PREVIEW_TEXT_TYPE";s:4:"html";s:14:"DETAIL_PICTURE";N;s:15:"~DETAIL_PICTURE";N;s:11:"DETAIL_TEXT";s:4554:"В настоящее время сотни миллионов квадратных метров кровельных мембран на основе EPDM и ТПО успешно применяются во всем мире. Используют кровельные системы:<br>
<h5><br>
</h5>
<h5>Балластная система</h5>
 <img width="245" alt="бал 2.jpg" src="/upload/medialibrary/be8/be8fe005f334fab5801ac2127198d816.jpg" height="135" title="бал 2.jpg"><br>
 <br>
 В основе балластной кровельной системы лежит ТПО-мембрана шириной 3.05 м. Балластная кровельная система обладает великолепной огнестойкостью и широким выбором подходящих оснований для мембраны. При выборе балластной кровельной ситемы необходимо поставить следующие вопросы - каков вес балластного слоя на крыше и выдержит ли конструкция крыши нагрузку от него. <br>
<h5><br>
 Клеевая система</h5>
<h5><img width="245" alt="клеев1.jpg" src="/upload/medialibrary/6b1/6b115b7e9894025925ef7a9a8c5a2d71.jpg" height="123" title="клеев1.jpg"></h5>
<h5><span style="font-size: 13px; font-weight: normal;">В клеевой кровельной системе также используются листы шириной 3.05 м. Клеевая кровельная система применяется при любом уклоне крыши, имеет малый вес и высокую устойчивость против ветровых нагрузок. Клеевая кровельная система подходит для крыш любой формы и имеет подчеркнутый эстетический вид. Необходимо понимать, что темные цвета мембраны поглощают больше тепла в летнее время, которое влияет на температуру сварки и создает дополнительные трудности при выполнении сварочных швов. Поэтому теперь вместо темных мембран используются светлые. При выборе полностью приклеенной кровельной системы необходимо проверить, имеется ли подходящее основание. Также при выборе неоходимо руководствоваться возможностью укладки новой теплоизоляции, ее совместимостью, способом и схемой крепления. Однако светло-серый цвет понижает температуру мембраны и увеличивает время высыхания клея.</span><br>
 </h5>
 <span style="font-size: 13px; font-weight: normal;">
<h5>Механическая система</h5>
 </span>
<p>
 <img width="245" alt="мех.jpg" src="/upload/medialibrary/7d0/7d0c1a3ec35e5fce99f301d6edb60aee.jpg" height="119" title="мех.jpg"><br>
</p>
<p>
	 В механической кровельной системе используются рулоны шириной до 2.44 м. Основными преимуществами механической кровельной системы являются малый вес и быстрая укладка за счет значительно меньшего количества швов. При выборе механически закрепленной кровельной ситстемы необходимо определить способ и схемы закрепления мембраны.
</p>
<h5>
Клеи, герметики, очиститель и окрасочный состав: </h5>
<p>
</p>
 <img width="240" alt="клеи.jpg" src="/upload/medialibrary/c25/c25691895be2f2da24c695b0e3ee680a.jpg" height="158" title="клеи.jpg"><br>
 - Монтажный клей;<br>
 - Монтажный клей на водной основе;<br>
 - Клей для швов;<br>
 - Краевой герметик;<br>
 - Водоотталкивающая мастика;<br>
 - Жидкий герметик;<br>
 - Очиститель.<br>
<p>
</p>
