 </h5>
 <span style="font-size: 13px; font-weight: normal;">
<h5>Механическая система</h5>
 </span>
<p>
 <img width="245" alt="мех.jpg" src="/upload/medialibrary/7d0/7d0c1a3ec35e5fce99f301d6edb60aee.jpg" height="119" title="мех.jpg"><br>
</p>
<p>
