 <b>Фальцевая кровля</b> стала так называться за счет особого метода крепления друг к другу металлических листов материала для кровли. Благодаря специальной системе стыков гарантируется абсолютная герметичность без клеевых швов, резиновых уплотнителей, а также, что самое важное, без сквозных отверстий, могущих вызвать протечки. Помимо этого, за счет ребер жесткости, полученных в процессе фальцевания, кровля получает дополнительную прочность и большую выразительность.
</p>";s:13:"~PREVIEW_TEXT";s:877:"<p>
