	 Фальцевая кровля изготавливается из двух видов&nbsp;стали <b>GreenCoat </b>(сталь премиум-класса из Северной Европы)&nbsp;и <b>POLYESTER </b>(сталь Российского производства).
</div>
<h5><br>
 </h5>
<h5>Сталь GreenCoat</h5>
 Исключительно долговечный материал с покрытием GreenCoat Pro BT, предназначенный в основном для кровельных работ, поставляется как с обычной, так и с матовой поверхностью. Наряду с изготовлением металлочерепицы и фальцевой кровли, покрытие GreenCoat Pro BT идеально подходит для жестяных работ и для нанесения на высокоформуемые стали PLX и FAP.<br>
