	 Продукция торговой марки <b>AQUASYSTEM</b> изготовлена из лучших видов импортного сырья от ведущих европейских производителей. Сырьем для производства служат: холоднокатаная горячеоцинкованная сталь с полимерным покрытием Pural, Медь, Цинк-Титан и Алюминий. Универсальность продукции <b>AQUASYSTEM</b>, ее высокие эксплуатационные характеристики, возможность ее применения на любой кровле и в любых климатических условиях, сделали ее популярной среди профессионалов и потребителей.
</p>
