Достоинства водостоков «Vinyl-On» </h4>
<p>
	 Разрабатывая конструкцию пластиковых водостоков, компания-производитель ориентировалась на достижение 3-х главных целей:
</p>
<p>
</p>
<div>
	·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; повысить надежность и долговечность системы, <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; обеспечить быстроту и удобство монтажа, <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; создать эстетичность системы в сборе.
</div>
<p>
</p>
<p>
 <b>Система экспресс-монтажа «EasyFix»</b>
</p>
<p>
	 Водостоки легко установить даже в одиночку. Фитинги «Vinyl-On» предусматривают возможность применения в процессе установки обычных кровельных саморезов диаметром 4,8 мм и 5,5 мм. Монтажные отверстия кронштейна удобно расположены. Благодаря этому система надежно закрепляется и устанавливается практически из каждого положения и при различном варианте стропильной системы.
</p>
<p>
	 Желоб с усиленными краями прекрасно держит форму, не перекручиваясь при монтаже в кронштейны. Он защелкивается в кронштейны одним несложным движением.
</p>
<p>
	 Специально разработанные микроупоры на элементах водостоков помогают правильной установке желоба в зависимости от t воздуха.
</p>
<p>
 <b>Повышенная прочность</b>
</p>
<p>
	 Сплав ПВХ и силикона обеспечивает прочность и эластичность серых уплотнителей при t от – 60° до + 50° С. Система полностью герметична и сохраняет свои свойства в любое время года.
</p>
<p>
 <b>Повышенная несущая способность</b>
</p>
<p>
	 Дополнительные ребра жесткости увеличивают несущую способность к горизонтальным и вертикальным нагрузкам.
</p>
<p>
	 Смонтированный хомут выдерживает нагрузку 100 кг благодаря усиленному основанию.
</p>";s:12:"~DETAIL_TEXT";s:2911:"<h4>
