 <b>Пластиковая водосточная система PROFiL </b>- Отличается от своих аналогов прочностью, красотой и безупречностью. Главным качеством этого водостока является то, что при производстве в него добавляют специальные компоненты, которые не допускают разрушения от снега или дождей.
</p>";s:17:"PREVIEW_TEXT_TYPE";s:4:"html";s:18:"~PREVIEW_TEXT_TYPE";s:4:"html";s:14:"DETAIL_PICTURE";N;s:15:"~DETAIL_PICTURE";N;s:11:"DETAIL_TEXT";s:4594:"<p>
</p>
<p>
 <b>Водосточная система PROFiL</b> производится из высококачественного поливинилхлорида, который отличается повышенной механической прочностью, химической стойкостью и легким весом. Водосток безупречно выдерживает экстремальные нагрузки в виде ливневых дождей летом и намерзания льда зимой.
</p>
<p>
 <span style="font-size: 10pt;"><b><span style="font-size: 13pt;">Преимущества:</span></b></span>
</p>
<p>
</p>
<div>
	·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; равномерное окрашивание в массе: добавление красителя непосредственно в материал способствует сохранению цвета системы на протяжении всего срока эксплуатации, а специальные компоненты обеспечивают защиту водостока от ультрафиолетового излучения <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; герметичность системы обеспечивается высококачественным EPDM каучук уплотнителем, который компенсирует линейное расширение при температурных колебаниях <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; соединитель желоба с вкладкой, который служит дополнительным ребром жесткости – тем самым придает системе большую прочность, полностью исключая возможные протекания <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; специальная форма желоба препятствует переливанию воды во время интенсивных осадков и гарантирует высокую эффективность отвода воды <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; высокая эффективность отвода воды - одна водосточная труба диаметром 100 мм отводит воду с крыши площадью 220 м<sup>2</sup> <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; система устойчива к атмосферным осадкам, содержащим кислоты, соли и активные химические элементы <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; легкий вес системы в сравнении с металлическими водостоками <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; удобство и простота монтажа <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; обладает молекулярной памятью, поэтому после деформации водостоки PROFiL восстанавливают свою первоначальную форму <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; работает бесшумно даже при интенсивном водоотводе <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; возможность производства элементов под заказ позволяет установить систему на кровли любой конфигурации, что гармонично дополняет облик здания и делает его более элегантным <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; беспрепятственный сток воды и защиту водосточного желоба от забивания обеспечивает полимерная сетка Levex Tube <br>
	 ·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; универсальный элемент водоотвода - отвод для сбора дождевой воды в специальные контейнера (отвод является подвижным и заменяемым элементом - его можно закрыть и тогда водосточная труба работает в обычном режиме сливая воду через колено).
</div>
